import React,{useState, useEffect} from 'react'

export default function News() {
    const[news, setNews]= useState([])

    useEffect(() => {
        fetch('https://newsdata.io/api/1/news?apikey=pub_159339806cec8307b7e92bec7e77972ebfc45&country=us&category=science,technology,top&language=en')
        .then(response => response.json())
        .then(setNews)
    },[])
  return (
    <div>
        <h3>{news}</h3>
        <p>Description</p>
        <p>More</p>
    </div>
  )
}
